import './App.css';
import Painel from './components/Painel'
import Menu from './components/Menu'

function About(){
  return(
    <div className="about"> 
      <h2>Sobre Mim</h2>
    </div>
  )
}
function App() {
  return (
    <div className="App">
      {Menu()},
      {Painel()},
      {About()};
    </div>
  );
}

export default App;
